import React from "react";
import ClueItem from "./search/ClueItem";

const PostList = ({ clues, title }) => {
  if (!clues.length) {
    return <h1 style={{ textAlign: "center" }}>No questions found!</h1>;
  }
  return (
    <div>
      <h1 style={{ textAlign: "center" }}>{title}</h1>
      {clues.map((clue, index) => (
        <ClueItem number={index + 1} clue={clue} />
      ))}
    </div>
  );
};

export default QuestionList;
